    data: |
      SELECT ALL - col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - - col1 NOT BETWEEN col2 AND NULL OR NOT + 68 <= 53;
  - name: tab2

outputs:
  - name: q11849.out
    data: |
      -51
      -67
      -77
